tables.table_schema:
CREATE TABLE vocal_exercises (
    exercise_id UUID PRIMARY KEY,
    exercise_name VARCHAR(255) NOT NULL,
    difficulty_level INT,
    duration_minutes INT
);

CREATE TABLE Vocalists (
    vocalist_id UUID PRIMARY KEY,
    first_name VARCHAR(50),
    last_name VARCHAR(50),
    vocal_range VARCHAR(20),
    preferred_warmup_id UUID
);
CREATE TABLE Warmups (
    warmup_id UUID PRIMARY KEY,
    warmup_name VARCHAR(100),
    duration_minutes INT,
    difficulty_level INT
);
CREATE TABLE VocalistWarmups (
    vocalist_warmup_id UUID PRIMARY KEY,
    vocalist_id UUID,
    warmup_id UUID,
    date_completed DATE
);

CREATE TABLE exercises (
    exercise_id SERIAL PRIMARY KEY,
    exercise_name TEXT NOT NULL,
    difficulty_level INT,
    duration_minutes INT
);

CREATE TABLE singers (
    singer_id SERIAL PRIMARY KEY,
    singer_name TEXT NOT NULL,
    voice_type TEXT,
    experience_level TEXT
);

CREATE TABLE singer_exercises (
    singer_exercise_id SERIAL PRIMARY KEY,
    singer_id INT NOT NULL,
    exercise_id INT NOT NULL,
    date_completed DATE
);

CREATE TABLE Singers (
	id INT PRIMARY KEY,
	name VARCHAR(100) NOT NULL,
	voice_type VARCHAR(50) NOT NULL
);

CREATE TABLE Exercises (
	id INT PRIMARY KEY,
	exercise_name VARCHAR(100) NOT NULL,
	difficulty_level INT NOT NULL
);

CREATE TABLE Categories (
	id INT PRIMARY KEY,
	category_name VARCHAR(100) NOT NULL,
	description TEXT
);

CREATE TABLE WarmUps (
	id INT PRIMARY KEY,
	warmup_title VARCHAR(100) NOT NULL,
	recommended_duration INT
);
